r being made , understand English or they need not to work at a drive thru                                                           \n","6 I work for door dash and they locked us all out to wait in a long line for no reason at 10. I tried to beg them to open it because I'm door dash and they refused.  Covid is over get a new job                                                                                                                                                                                    \n","  rating \n","1 1 star \n","2 4 stars\n","3 1 star \n","4 5 stars\n","5 1 star \n","6 1 star "]},"metadata":{},"output_type":"display_data"}],"source":["## Reading the McDonald_s_Reviews.csv file\n","McReviews <- read_csv(\"/kaggle/input/mcdonalds-store-reviews/McDonald_s_Reviews.csv\")\n","\n","head(McReviews)\n","# Error due to prescence of emojis"]},{"cell_type":"markdown","id":"53235cb2","metadata":{"papermill":{"duration":0.007805,"end_time":"2023-12-26T16:47:01.169178","exception":false,"start_time":"2023-12-26T16:47:01.161373","status":"completed"},"tags":[]},"source":["# 2 - Cleaning the data, tokenizing and removing stop words"]},{"cell_type":"code","execution_count":3,"id":"b6706a6e","metadata":{"_kg_hide-input":false,"execution":{"iopub.execute_input":"2023-12-26T16:47:01.188563Z","iopub.status.busy":"2023-12-26T16:47:01.186966Z","iopub.status.idle":"2023-12-26T16:47:04.492714Z","shell.execute_reply":"2023-12-26T16:47:04.490534Z"},"papermill":{"duration":3.319069,"end_time":"2023-12-26T16:47:04.496063","exception":false,"start_time":"2023-12-26T16:47:01.176994","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li><span style=white-space:pre-wrap>'Why does it look like someone spit on my food?\\nI had a n