QEAACg7SvBPigEAAKA0ld0/KQYAAIAiIdgBAAAoBMEO\nAABAIQh2AAAACkGwAwAAUAiCHQAAgEIQ7AAAABSCYAcAAKAQBDsAAACFINgBAAAoBMEOAABA\nIf4PWOSMT71hVwEAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["## Recoding the locations\n","McSentimentLocation$truncated_address <- sapply(strsplit(McSentimentLocation$store_address, \",\"), function(x) paste(x[1], x[2], sep = \",\"))\n","\n","## Getting a location wise color palette\n","color_palette <- rainbow(length(unique(McSentimentLocation$truncated_address)))\n","                                                \n","## Truncating the location address upto second comma\n","McSentimentLocation$location_code <- as.numeric(factor(McSentimentLocation$truncated_address))\n","\n","## Create a mapping of numeric codes to location names\n","code_location_mapping <- unique(McSentimentLocation[c(\"location_code\", \"truncated_address\")])\n","\n","## Combined location code and truncated address\n","code_location_mapping$combined_label <- paste(code_location_mapping$location_code, code_location_mapping$truncated_address, sep = \" - \")\n","                                                \n","# Plotting the stacked bar graph with numeric codes and location names in the legend\n","LocationSentiment <- ggplot(McSentimentLocation, aes(x = as.factor(location_code), y = score, fill = as.factor(location_code))) +\n","  geom_bar(stat = \"identity\", position = \"stack\", color = \"black\") +\n","  scale_fill_manual(values = rainbow(length(unique(McSentimentLocation$truncated_address))),\n","                    breaks = unique(McSentimentLocation$location_code),\n","                    labels = code_location_mapping$combined_label) +\n","  theme_minimal() +\n","  labs(title = \"Sentiment Scores for McDonald's Store Locations (US)\",\n","       x = \"Location Code\",  # Modify x-axis label\n","       y = \"Sentiment Score\") +\n","  theme(axis.text.x = element_text(angle = 60, hjust = 1),\n","        axis.title.x = element_text(size = 10))\n","\n","LocationSentiment\n","ggsave(\"LocationSentiment.png\", plot = LocationSentiment)  \n"]},{"cell_type":"markdown","id":"0efb44cc","metadata":{"papermill":{"duration":0.022544,"end_time":"2023-12-26T16:47:14.943307","exception":false,"start_time":"2023-12-26T16:47:14.920763","status":"completed"},"tags":[]},"source":["# Conclusion\n","* The customers are actively speaking on the McDonald's experience as per the word cloud.\n","* The overall sentiment analysis provides a slightly positive sentiment score of 0.058.\n","* Client reviews for store 10 (1415 E State Rd, Fern Park) shows the highest positive sentiment score.\n","* Comparatively, store 14 (1650 Washington Ave, Miami Beach) shows the higest negative sentiment score.\n","* 28/40 stores are showing positive sentiment scores, which indicates good client satisfaction, while indicating room for possible improvements for those with negative scores."]},{"cell_type":"markdown","id":"e321c3bf","metadata":{"papermill":{"duration":0.021729,"end_time":"2023-12-26T16:47:14.9858","exception":false,"start_time":"2023-12-26T16:47:14.964071","status":"completed"},"tags":[]},"source":["# References\n","\n","Dataset:\n","Elgiriyewithana, N. (2023) ‘McDonald’s Store Reviews’. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3422393,"sourceId":5968827,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":20.652044,"end_time":"2023-12-26T16:47:15.12801","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-12-26T16:46:54.475